import React from 'react';
import './weatherinfo.css';
import pressureIcon from './icon/pressure.png';
import humidityIcon from './icon/humidity.png';
import windIcon from './icon/wind.png';

const WeatherInfo = props => {
    const {
        city,
        date,
        temp,
        temp_min,
        temp_max,
        sunrise,
        sunset,
        pressure,
        humidity,
        windspeed,
        err,
    } = props.weather

    let content = null;

    if(!err && city) {

        const sunriseTime = new Date(sunrise * 1000).toLocaleTimeString()
        const sunsetTime = new Date(sunset * 1000).toLocaleTimeString()
        content = (
            <>
                <h4>Wyniki wyszukiwania dla miasta{city} </h4>
                <h4>Data i godzina: {date} </h4>
                <h2>{temp}&#175;C</h2>
                <div>
                    <img src={pressureIcon} alt="pressure icon"/><h3> {pressure}</h3>
                    <img src={humidityIcon} alt="humidity icon"/>
                </div>

                <h3>  {humidity}</h3>
                <h3> <img src={windIcon} alt="wind icon"/> {windspeed}</h3>
                <h4>Temperatura minimalna: {temp_min}&#175;C</h4>
                <h4>Temperatura maksymalna: {temp_max}&#175;C</h4>
                <h4>Wschód Słońca: {sunriseTime}</h4>
                <h4>Zachód Słońca: {sunsetTime}</h4>


            </>
        )
    }
    return (
        <div className="weatherInfo">
            {err ? `Nie ma w bazie wyszukiwanego miasta: ${city}` : content}
        </div>
    )
}

export default WeatherInfo;
